function newLogin() {

    /*
        const [username, setUsername] = useState("");
        const [email, setEmail] = useState("");
        const [password, setPassword] = useState("");
        const [login, setLogin] = useState("");
        const [register, setregister] = useState("");
    */
    return (
        <div className="container">
            <div className="loginForm">
                <form>
                    <h4>Login Here</h4>
                    <label htmlFor="username">Username*</label>
                    <input className="textInput" type="text" name="username" placeholder="Enter your Username" required />
                    <label htmlFor="password">Password*</label>
                    <input className="textInput" type="password" name="password" placeholder="Enter your Password" required />
                    <input className="button" type="submit" value="Login" />
                    <h1 style={{ color: 'red', fontSize: '15px', textAlign: 'center', marginTop: '20px' }}>{loginStatus}</h1>
                </form>
            </div>
            <div className="loginForm">
                <form>
                    <h4>Register Here</h4>
                    <label htmlFor="email">Email Address*</label>
                    <input className="textInput" type="text" name="email" placeholder="Enter your Email Address" required />
                    <label htmlFor="username">Username*</label>
                    <input className="textInput" type="username" name="username" placeholder="Enter your Username" required />
                    <label htmlFor="password">Password*</label>
                    <input className="textInput" type="password" name="password" placeholder="Enter your Password" required />
                    <input className="button" type="submit" value="Create an account" />
                    <h1 style={{ fontSize: '15px', textAlign: 'center', marginTop: '20px' }}>{registerStatus}</h1>
                </form>
            </div>
        </div>
    );
}

export default newLogin;
